ony podczas instalacji zawartości demonstracyjnej.','Setup Demo Content'=>'Skonfiguruj zawartość demonstracyjną','Setup ages and taxonomies...'=>'Konfiguracja wieku i taksonomii...','Setup images...'=>'Konfiguracja obrazów...','Setup places, service and FAQ posts ...'=>'Konfiguracja miejsc, usług i postów FAQ...','Setup rules, categories, booking object posts...'=>'Konfiguracja zasad, kategorii, postów obiektów rezerwacji...','Next steps:'=>'Następne kroki:','Go to %1$sAll items%2$s page and check created items on front-end'=>'Przejdź do strony %1$sWszystkie elementy%2$s i sprawdź utworzone elementy na stronie frontowej','Edit demo content or create your own (read setting details in %1$sDocumentation%2$s)'=>'Edytuj zawartość demonstracyjną lub utwórz własną (przeczytaj szczegóły ustawień w %1$sDokumentacji%2$s)','Addons for BA Book Everything plugin'=>'Dodatki do wtyczki BA Book Everything','BABE Payment pack'=>'BABE Payment pack','Integrates PayPal and Credit Cards (Stripe) payments. Stripe integration supports 3D Secure card payments, Apple Pay, Google Pay, Microsoft Pay and the Payment Request API.'=>'Integruje płatności PayPal i kartami kredytowymi (Stripe). Integracja Stripe obsługuje płatności kartą 3D Secure, Apple Pay, Google Pay, Microsoft Pay i API żądania płatności.','BABE Backoffice'=>'BABE backoffice','Management tools: PDF invoices, backend bookings, editing/cancellation orders, extra charge, full and partial refund, iCal synchronization, export orders to xlsx, emails and order status router customizer.'=>'Narzędzia zarządzania: faktury PDF, rezerwacje z poziomu panelu, edycja/anulowanie zamówień, dodatkowe opłaty, pełny i częściowy zwrot, synchronizacja iCal, eksport zamówień do xlsx, konfigurator e-maili i statusów zamówień.','BABE Currency switcher'=>'BABE Currency switcher','Currency switcher widget. Options: force booking and checkout in the base currency, turn on payment gateways on the checkout depending on currency.'=>'Widget przełącznika walut. Opcje: wymuszenie rezerwacji i płatności w walucie podstawowej, włączanie bramek płatności przy kasie w zależności od waluty.','BABE Marketplace'=>'BABE marketplace','Multi Vendor Marketplace extension for BA Book Everything plugin transforms your booking site into a marketplace.'=>'Rozszerzenie Multi Vendor Marketplace dla wtyczki BA Book Everything przekształca twoją stronę rezerwacji w marketplace.','BABE Payment Bank transfer'=>'BABE Payment Bank transfer','Added a Bank transfer payment option: show bank transfer details on checkout, order confirmation and in the customer email.'=>'Dodana opcja płatności przelewem bankowym: pokazuje dane do przelewu bankowego przy kasie, potwierdzeniu zamówienia i w e-mailu do klienta.','20+ Payment Gateways'=>'Ponad 20 bramek płatności','Check our ready-made integrations with over 20 payment gateways.'=>'Sprawdź nasze gotowe integracje z ponad 20 bramkami płatności.','Learn more'=>'Dowiedz się więcej','Management tools: PDF invoices, backend bookings, editing/cancelation orders, extra charge, full and partial refund, iCal synchronization.'=>'Narzędzia zarządzania: faktury PDF, rezerwacje z poziomu panelu, edycja/anulowanie zamówień, dodatkowe opłaty, pełny i częściowy zwrot, synchronizacja iCal.','Date format'=>'Format daty','Booking object post slug'=>'Slug postu obiektu rezerwacji','Booking object singular name'=>'Nazwa pojedynczego obiektu rezerwacji','Booking object general (plural) name'=>'Ogólna nazwa (liczba mnoga) obiektu rezerwacji','Booking object menu name'=>'Nazwa menu obiektu rezerwacji','Prefix for custom taxonomies (*before changing this option it is required to remove all custom taxonomies)'=>'Prefiks dla niestandardowych taksonomii (*przed zmianą tej opcji wymagane jest usunięcie wszystkich niestandardowych taksonomii)','Select search result page'=>'Wybierz stronę wyników wyszukiwania','Services page'=>'Strona usług','Checkout page'=>'Strona kasy','Confirmation page'=>'Strona potwierdzenia','Terms & Condition